CREATE FUNCTION public.inserir_arquivamentos() 
 RETURNS integer AS 
$BODY$
DECLARE
    arquivamento RECORD;
    processo_itec processos.id%TYPE;  
    setor processos.id%TYPE; 
    contador INTEGER;
BEGIN
contador:=0;
-- BUSCA PROCESSO ANEXOS DA UNCISAL
    FOR arquivamento in SELECT * from sipa_uncisal.arquivamentos ORDER BY processo_id ASC LOOP
    contador := contador + 1;    

        SELECT id into processo_itec FROM processos where id_uncisal = arquivamento.processo_id LIMIT 1;
    SELECT id INTO setor FROM setores WHERE id_uncisal = arquivamento.setor_id LIMIT 1;

    INSERT INTO arquivamentos (processo_id,setor_id,motivo,data,data_desarquivamento,motivo_desarquivamento) VALUES (processo_itec,setor,arquivamento.motivo,arquivamento.data,arquivamento.data_desarquivamento,arquivamento.motivo_desarquivamento);

    RAISE NOTICE 'QUANTIDADE PROCESSADA: %', contador;

    END LOOP;

    RETURN 1;
END
$BODY$
 LANGUAGE 'plpgsql' VOLATILE;

