CREATE FUNCTION public.inserir_processos() 
 RETURNS integer AS 
$BODY$
DECLARE
    processo_uncisal RECORD;
    verificacao processos.id%TYPE;
    servidor_uncisal RECORD;
    natureza_uncisal RECORD;
    interessado_uncisal RECORD;
    setor_uncisal RECORD;
    orgao_uncisal RECORD;
    novo_numero_orgao processos.numero_orgao%TYPE;
BEGIN

    CREATE INDEX idx_naturezas_id_uncisal ON naturezas (id_uncisal);
    CREATE INDEX idx_setores_id_uncisal ON setores (id_uncisal);
    CREATE INDEX idx_servidores_id_uncisal ON servidores (id_uncisal);
    CREATE INDEX idx_interessados_id_uncisal ON interessados (id_uncisal);

/************************************************************************************************/
    FOR processo_uncisal IN SELECT * FROM sipa_uncisal.processos LOOP

/*-- Verifica se já existe processo com número igual*/

        SELECT id INTO verificacao 
        FROM processos 
        WHERE (numero_orgao = processo_uncisal.numero_orgao OR numero_orgao||'0' = processo_uncisal.numero_orgao) 
    AND numero_processo = processo_uncisal.numero_processo 
    AND numero_ano = processo_uncisal.numero_ano;

    IF (verificacao IS NULL) THEN

    ----CASO NAO EXISTA O PROCESSO: INSERIR NA BASE DO ITEC

        --Seleciona id do setor criado no itec
        SELECT id INTO setor_uncisal FROM setores where id_uncisal = processo_uncisal.setor_id ORDER BY id desc LIMIT 1;

        --Seleciona id do servidor criado no itec
        SELECT id INTO servidor_uncisal FROM servidores where id_uncisal = processo_uncisal.servidor_id ORDER BY id desc LIMIT 1;

        --Seleciona id da natureza criada no itec
        SELECT id INTO natureza_uncisal FROM naturezas where id_uncisal = processo_uncisal.natureza_id ORDER BY id desc LIMIT 1;

        --Seleciona id do interessado criado no itec
        SELECT id INTO interessado_uncisal FROM interessados where id_uncisal = processo_uncisal.interessado_id ORDER BY id desc LIMIT 1;

        --CORRIGE NUMERO DO ORGAO; pegar numero do orgao no itec com id_da uncisal
        SELECT codigo into novo_numero_orgao from orgaos where (codigo||'0' =  processo_uncisal.numero_orgao or codigo = processo_uncisal.numero_orgao) LIMIT 1;
        IF (novo_numero_orgao is NULL) then        
            novo_numero_orgao = '4101';        
        END IF;

        INSERT INTO processos     (interessado_id,natureza_id,servidor_id,setor_id,situacao_id,numero_orgao,numero_processo,numero_ano,titulo_assunto,assunto,data_cadastro,processo_externo,volumes,paginas,documento_numero,id_uncisal)
VALUES (interessado_uncisal.id, natureza_uncisal.id, servidor_uncisal.id, setor_uncisal.id, processo_uncisal.situacao_id, novo_numero_orgao,processo_uncisal.numero_processo, 
    processo_uncisal.numero_ano, processo_uncisal.titulo_assunto, processo_uncisal.assunto, processo_uncisal.data_cadastro, processo_uncisal.processo_externo, processo_uncisal.volumes, 
    processo_uncisal.paginas,processo_uncisal.documento_numero,processo_uncisal.id);

        RAISE NOTICE 'PROCESSO INSERIDO = "%"', processo_uncisal.id;
    ELSE
        --CASO EXISTE O PROCESSO: SETAR para processo INTERNO caso     
    UPDATE processos set processo_externo = 'f' where id = verificacao;
        RAISE NOTICE 'PROCESSO ATUALIZADO';

    END IF;
    RAISE NOTICE 'Processo com o id = "%"', verificacao;

    END LOOP;

    DROP INDEX idx_naturezas_id_uncisal;
    DROP INDEX idx_setores_id_uncisal;
    DROP INDEX idx_servidores_id_uncisal;
    DROP INDEX idx_interessados_id_uncisal;

    RETURN 1;
END
$BODY$
 LANGUAGE 'plpgsql' VOLATILE;

CREATE FUNCTION public.inserir_processos_anexos() 
 RETURNS integer AS 
$BODY$
DECLARE
    processo RECORD;
    processo_principal processos.id%TYPE;    
    processo_anexo processos.id%TYPE;
    contador INTEGER;
BEGIN
contador:=0;
-- BUSCA PROCESSO ANEXOS DA UNCISAL
    FOR processo in SELECT * from sipa_uncisal.processos_anexos ORDER BY processo_principal_id ASC LOOP
    contador := contador + 1;    
        SELECT id into processo_principal FROM processos where id_uncisal = processo.processo_principal_id;
        SELECT id into processo_anexo FROM processos where id_uncisal = processo.processo_anexo_id;

    INSERT INTO processos_anexos (processo_principal_id,processo_anexo_id) VALUES (processo_principal,processo_anexo);

    RAISE NOTICE 'QUANTIDADE PROCESSADA: %', contador;

    END LOOP;

    RETURN 1;
END
$BODY$
 LANGUAGE 'plpgsql' VOLATILE;

CREATE FUNCTION public.inserir_setores_servidores() 
 RETURNS integer AS 
$BODY$
DECLARE
    setor_servidor RECORD;
    setor setores.id%TYPE;    
    servidor servidores.id%TYPE;
    contador INTEGER;
BEGIN
contador:=0;
-- BUSCA PROCESSO ANEXOS DA UNCISAL
    FOR setor_servidor in SELECT * from sipa_uncisal.setores_servidores LOOP
    contador:=contador+1;    
        SELECT id into setor FROM setores where id_uncisal = setor_servidor.setor_id;
        SELECT id into servidor FROM servidores where id_uncisal = setor_servidor.servidor_id;

    INSERT INTO setores_servidores (setor_id,servidor_id) VALUES (setor,servidor);

    RAISE NOTICE 'QUANTIDADE PROCESSADA: %', contador;

    END LOOP;

    RETURN 1;
END
$BODY$
 LANGUAGE 'plpgsql' VOLATILE;

CREATE FUNCTION public.inserir_tramites() 
 RETURNS integer AS 
$BODY$
DECLARE
    processo RECORD;
    tramite RECORD;
    setorOrigem tramites.setor_origem_id%TYPE;    
    setorRecebimento tramites.setor_origem_id%TYPE;
    servidorOrigem tramites.setor_origem_id%TYPE;
    servidorRecebimento tramites.setor_origem_id%TYPE;
BEGIN

--criando indices
CREATE INDEX idx_setores_id_uncisal ON setores (id_uncisal);
CREATE INDEX idx_servidores_id_uncisal ON servidores (id_uncisal);
CREATE INDEX idx_processos_id_uncisal ON processos (id_uncisal);
CREATE INDEX idx_tramites_processo_id ON sipa_uncisal.tramites (processo_id);

    --Para cada processo importado da uncisal
    FOR processo IN SELECT id,numero_orgao,numero_processo,numero_ano,id_uncisal FROM processos WHERE id_uncisal is not null ORDER BY id LOOP

        RAISE NOTICE 'processo: %-%/%id=%/id_uncisal=%', processo.numero_orgao, processo.numero_processo, processo.numero_ano, processo.id,processo.id_uncisal;

        FOR tramite IN SELECT * FROM sipa_uncisal.tramites WHERE processo_id = processo.id_uncisal LOOP
            SELECT id INTO setorOrigem FROM setores WHERE id_uncisal = tramite.setor_origem_id;
            SELECT id INTO setorRecebimento FROM setores WHERE id_uncisal = tramite.setor_recebimento_id;
            SELECT id INTO servidorOrigem FROM servidores WHERE id_uncisal = tramite.servidor_origem_id;
            SELECT id INTO servidorRecebimento FROM servidores WHERE id_uncisal = tramite.servidor_recebimento_id;    

            INSERT INTO tramites (processo_id, setor_origem_id, servidor_origem_id, data_tramite, setor_recebimento_id, servidor_recebimento_id, data_recebimento, flag_recebimento, observacoes) 
VALUES (processo.id, setorOrigem, servidorOrigem, tramite.data_tramite, setorRecebimento, servidorRecebimento, tramite.data_recebimento, tramite.flag_recebimento, 'PROCESSO IMPORTADO DA UNCISAL');

            RAISE NOTICE 'tramite: %', tramite.data_tramite;

        END LOOP;
    END LOOP;

DROP INDEX idx_setores_id_uncisal;
DROP INDEX idx_servidores_id_uncisal;
DROP INDEX idx_processos_id_uncisal;
DROP INDEX sipa_uncisal.idx_tramites_processo_id;

    RETURN 1;
END
$BODY$
 LANGUAGE 'plpgsql' VOLATILE;
